import React from 'react';
import Footer from './Footer';
import Header from './Header';
import CreateNote from './CreateNote';
import Notes from './Note'

const App = ()=>{

    const addNote = (Note) =>{
        alert("clicked");
    }

    return(
        <>
            <Header/>
            <CreateNote  
            passNote = {addNote}
            />
            <Notes/>
            <Footer/>
        </>
    );
};

export default App;
